import React from "react";
import "./interests.styles.css"

function Interests(){
    return(
        <div className="interests">

            <h2>Interests</h2>
            <p>Enthuastic on Full-stack Developing and highly motivated to deliver results in a demanding environment. Learning new technologies and frameworks is my passion! </p>
        </div>

    )
}


export default Interests
